INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 2, 1001, 1, 1, 1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1, "春咲 ひより", "お！\nあそこに困ってそうな人発見！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "みんなみたいに\nわたしも強くならなきゃ", 0, 2, 1002, 1, 1, 1.4, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1, "草野 優衣", "大切な人を\n守れるようになりたい…って", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "フェンシングを始めてみては？", 0, 2, 1003, 1, 1, 1.4, "少しは磨かれると思いますよ。", 0, 0, 1, "士条 怜", "キミに必要な集中力と感性が", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "ねぇ、にいちゃん！", 0, 2, 1004, 1, 1, 1.5, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1, "穂高 みそぎ", "今日はなにして遊ぶ？", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "風宮あかりです", 0, 2, 1006, 1, 1, 1.4, "私といっしょに…\nいかない？", 0, 0, 1, "風宮 あかり", "ねぇ…", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "出雲宮子なのー", 0, 2, 1007, 1, 1, 1.5, "食べ物の恨みは怖いのー", 0, 0, 1, "出雲 宮子", "プリンたべたいのー", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "ボクは虹村雪。", 0, 2, 1008, 1, 1, 1.4, "いいよ。\n見られることは運命さ…", 0, 0, 1, "虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "フッ…聞いて後悔するがいい！", 0, 2, 1009, 1, 1, 1.4, "人呼んで「疾風の冥姫」!!", 0, 0, 1, "柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 2, 1010, 1, 1, 1.5, "ほんまおおきにやわ～♪", 0, 0, 1, "姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "衣之咲璃乃です！", 0, 2, 1011, 1, 1, 1.4, "ここで会ったが\n100年目～！", 0, 0, 1, "衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 2, 1012, 1, 1, 1.4, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1, "柏崎 初音", "ち、超能力って…\n何のことかな～？", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "ちょす！\n美波鈴奈だよ～♪", 0, 2, 1016, 1, 1, 1.4, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1, "美波 鈴奈", "一応カリスマ読モJKやってまっす！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "はいたーい。\n喜屋武香織さー。", 0, 2, 1017, 1, 1, 1.4, "でも、沖縄もとってもいいとこさー", 0, 0, 1, "喜屋武 香織", "東京は遊園地みたいなところさー", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "支倉伊緒です。", 0, 2, 1018, 1, 1, 1.4, "イオちゃんって呼んでね。", 0, 0, 1, "支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 2, 1020, 1, 1, 1.5, "ミミをおいてかないでぇ～", 0, 0, 1, "茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 2, 1021, 1, 1, 1.5, "ふぇぇぇぇぇん……", 0, 0, 1, "栗林 くるみ", "あの……\nふぇ……", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "風宮よりです。\nあああああ！", 0, 2, 1022, 1, 1, 1.4, "なんてありがとうございます！", 0, 0, 1, "風宮 より", "こんな私に貴重な時間を\n割いていただき、", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 2, 1023, 1, 1, 1.5, "私こっち行きたいー\nね、早く早くー", 0, 0, 1, "北条 綾音", "おにいちゃんどこいくの？\nえ？", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "わっ…わっ…私、\n天野すずめといいます！", 0, 2, 1025, 1, 1, 1.4, "これて何か違う…\nあああすみません！", 0, 0, 1, "天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "……クスクス…私は\n…倉石恵理子……", 0, 2, 1027, 1, 1, 1.4, "離しませんわ………\n絶対に…!!", 0, 0, 1, "倉石 恵理子", "あなたは…運命の……\n伴侶……", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 2, 1028, 1, 1, 1.4, "…そうでしょ？？", 0, 0, 1, "佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "桜井望だよ！\nよろしくねっ", 0, 2, 1029, 1, 1, 1.4, "あはは、\n私もまだまだだなぁ～", 0, 0, 1, "桜井 望", "ぇっと…\nキミ、私のこと知らないの?!", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "デケデケデンっ！", 0, 2, 1030, 1, 1, 1.4, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1, "ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "上喜しのぶです。\n手元のドクロが父です。", 0, 2, 1031, 1, 1, 1.4, "おかしいですね……", 0, 0, 1, "上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 2, 1033, 1, 1, 1.5, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1, "野戸まひる", "けんども\nそれには足りないモンが…", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 2, 1034, 1, 1, 1.4, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1, "綾瀬 ゆかり", "ちょっと緊張しちゃって…", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "氷川鏡華…です", 0, 2, 1036, 1, 1, 1.5, "これ以上お話しすることは…\nないです！", 0, 0, 1, "氷川 鏡華", "知らない人とは話しちゃいけないので", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "柏崎…栞です。", 0, 2, 1038, 1, 1, 1.4, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1, "柏崎 栞", "……あ、アラーム。", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "ふ、双葉碧です。", 0, 2, 1040, 1, 1, 1.4, "野に咲く花が、\n唯一の話相手です。", 0, 0, 1, "双葉 碧", "私、一人も友達がいなくて……", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "三角千歌です。", 0, 2, 1042, 1, 1, 1.4, "そう思っています。", 0, 0, 1, "三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "安芸真琴だ。", 0, 2, 1043, 1, 1, 1.4, "う、疑ってすまなかったな…", 0, 0, 1, "安芸 真琴", "あぁ？\nお前のそいつの仲間か？", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "わらわこそは夜を総べる者！", 0, 2, 1044, 1, 1, 1.4, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1, "イリヤ・オーンスタイン", "生けとし生ける全ての者よ！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "そこで騎士は妖精を乱暴に……", 0, 2, 1045, 1, 1, 1.4, "ｌク、クウカに何かご用ですか!?", 0, 0, 1, "遠見 空花", "ぐふふふふ……はっ！", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 2, 1046, 1, 1, 1.4, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1, "宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "大神美冬よ！", 0, 2, 1048, 1, 1, 1.4, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1, "大神 美冬", "それでは早速クエストに…", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "星野静流だよ！", 0, 2, 1049, 1, 1, 1.4, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1, "星野静流", "クエストもバトルも\n掃除も洗濯も", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "アタシは玉泉美咲。", 0, 2, 1050, 1, 1, 1.5, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1, "玉泉美咲", "見ての通りの\nセクシー美少女で", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "？？？", 0, 2, 1052, 1, 1, 1.4, "？？？？", 0, 0, 1, "リマ", "？？？？", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1053, 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, "モニカ・ヴァイスヴィント", "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1058, 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, "ペコリーヌ", "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1059, 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, "コッコロ", "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1060, 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, "キャル", "菓子でつろうなどと\n稚拙な策を……", 0);
